お子さまの小さな手でも握りやすい細めのハンドル。<br>
ハンドルを押したり引っ張ったりすると、アコーディオンが色んな音を奏でるよ♪
<br>
サイズ：W9.5×D10.5×H23.5cm<br>
素材：ABS 樹脂、ポリプロピレン、熱可塑性エラストマー<br>
対象月齢：6カ月から<br>
重量：202g<br>
原産国：中国<br>

【・お手入れ方法】<br><br>
・固くしぼった濡れ布巾で拭き、完全に乾燥させてください。<br>
・水洗いしないでください。<br>
<br>
【ご使用上の注意】<br><br>
・ぶつけたり、こすったり、濡れたままで放置した場合、他のものに色が付着することがあります。<br>
・本製品は必ず保護者の目の届く場所で遊ばせてください。<br>
・他のおもちゃとつないだ状態で遊ばないでください。<!★★★★★かご上★★★★★-->



